   [659] = "看你踌躇满志的样子，成长的很快嘛！我有20个任务，你要不要试试啊？",
   [660] = "执笔之灵首席",
   [661] = "你可真是厉害，这么多任务都做完了！呐，这是给你的奖励，拿好哦！",
   [662] = "龙魂圣拳首席",
   [663] = "圣临战锤首席",
   [664] = "疾风剑客首席",
   [665] = "卡牌大师首席",
   [666] = "皇家枪手首席",
   [667] = "公会任务每周可以完成70个，完成所有任务后，记得将“试炼水晶”提交到公会试炼哦！",
   [668] = "公会会长",
   [669] = "赶紧将收集的“试炼水晶”提交到公会试炼中，然后我就可以召唤强大的试炼怪物了！",
   [670] = "要想转职，还需要经过一番考验，你准备好了吗？",
   [671] = "休",
   [672] = "立刻出发去极寒霜原找到[ffff00]埃克斯[-]开始第一关试炼吧。",
   [673] = "看到那边的[ffff00]极寒魔蛙[-]了吗？让我看看你有多少能耐！",
   [674] = "埃克斯",
   [675] = "有点意思，一道考验就算你通过了。去找[ffff00]贾尔斯[-]，接受他的考验吧！",
   [676] = "去帮我教训一下那些讨厌的[ffff00]雪域云兽[-]。",
   [677] = "贾尔斯",
   [678] = "总算出了口恶气，接下来的考验在泪湖沙漠，一路小心。",
   [679] = "泪湖沙漠有一群嚣张的[ffff00]沙盗[-]，你去帮我剿灭他们",
   [680] = "克里斯蒂安",
   [681] = "接下来你有资格挑战最后的考验了。去找到[ffff00]沃克利[-]，他会给你一个大大的惊喜。",
   [682] = "竟然这么快就通过了前三关的考验，确实有能力去[ffff00]【永恒空间】[-]试试了。",
   [683] = "沃克利",
   [684] = "[ffff00]【永恒空间】[-]？那是什么地方？",
   [685] = "0",
   [686] = "一个上古诸神遗留的特殊空间，详细情况[ffff00]神侍[-]会为你解答的，我这就送你过去！",
   [687] = "【永恒空间】中出现了深渊生物！事关重大，你立即返回[ffff00]神圣王城[-]向[ffff00]修[-]大人报告。",
   [688] = "你在【永恒空间】中遇到了深渊生物？菲奥烈大人还被控制了心智？",
   [689] = "是的，现在菲奥烈大人正独自留下来查明原因。",
   [690] = "居然可以影响神圣禁卫的心智，看来事情没有那么简单。你做的很好，这些就当做是给你的奖励吧。",
   [691] = "你来的正好，菲奥烈大人想要见你！",
   [692] = "菲奥烈大人希望你能协助他一起查明真相，不过在这之前你需要通过一些小小的考验来证明你的实力。",
   [693] = "好的大人，我愿意接受考验。",
   [694] = "去泪湖沙漠找到[ffff00]特里萨[-]，她曾经是菲奥烈大人曾经的部下之一。",
   [695] = "我们奉命镇压野猪人的暴动，想要证明自己的实力就去给我清理掉那边的[ffff00]石锤猪人[-]吧。",
   [696] = "特里萨",
   [697] = "哼，算你还有点本事，希望你不会拖累菲奥烈大人。接下来你去找[ffff00]贝拉米[-]吧。",
   [698] = "你来了，贝拉米脾气不好，她没有难为你吧？接下来是那边的[ffff00]链球猪人[-]，要小心他们的链球！",
   [699] = "贝拉米",
   [700] = "不愧是是菲奥烈大人看中的人，果然没有让我失望。去找[ffff00]尤尔[-]吧！",
   [701] = "在野猪人的营地深处有一群野猪人的精锐部队，叫[ffff00]黑鬃猪人[-]，去给他们来点深刻的教训！",
   [702] = "尤尔",
   [703] = "恭喜恭喜，恭喜你能活着回来。回去见[ffff00]修[-]吧，你已经合格了。",
   [704] = "看来这段时间你又变强了不少啊，赶紧去吧，别让菲奥烈大人等太久了。",
   [705] = "怎么样？事情调查清楚了吗？",
   [706] = "我们遭到了深渊魔神手下的袭击，我和菲奥烈大人联手击败了那个家伙。菲奥烈大人还受了点伤……",
   [707] = "菲奥烈大人受伤了？那他为什么没有和你一起回来。",
   [708] = "我们从那个深渊恶魔口中得知，深渊魔神意图降临永痕空间夺取时光之书。菲奥烈大人坚持要留下继续查探。",
   [709] = "他一定是不放心若琳大神官，哎！但愿他不会有事。这次的情报很重要，这是给你的奖励。",
   [710] = "好消息，菲奥烈大人传回讯息说已经找到了若琳大神官……",
   [711] = "太好了，菲奥烈大人这下可以放心了。",
   [712] = "先别高兴的太早，我还有一个坏消息：若琳大神官的情况和你当初遇到菲奥烈大人的时候一样，并且似乎还要更糟……",
   [713] = "我现在就去永恒空间，帮助菲奥烈大人唤醒大神官！",
   [714] = "别冲动，菲奥烈大人还说他上次的伤口并没有愈合的迹象，虽然他暂时用斗气压制住了伤口，不过我们还需要你的帮助。",
   [715] = "大人请说！",
   [716] = "我要你去烈焰战场帮我收集一些材料制作帮助菲奥烈大人治疗伤口的药物，那边有我的联络官，你现在赶紧出发。",
   [717] = "火蜥蜴体内的毒腺经过提炼之后是非常珍贵的药材，治疗菲奥烈大人的伤势需要非常非常多的毒腺。",
   [718] = "多宾",
   [719] = "这些应该足够了，我把毒腺带回王城交给修大人。",
   [720] = "去找到邓肯，他在收集时紫晶石怪的晶核",
   [721] = "紫晶石怪其实是纯净的土元素凝集的生物，体内的晶核可以在制作药物的过程中帮助稳定药性。",
   [722] = "邓肯",
   [723] = "晶核的能量很容易消散，我立刻动身回去王城。",
   [724] = "制作疗伤药还需要灵傀儡的骨粉，去找拉尔夫。",
   [725] = "给你，拿着这个，它能将灵傀儡的残害凝聚成需要的骨粉。",
   [726] = "拉尔夫",
   [727] = "辛苦你了，药材已经收集齐了，我这就带回去给休大人制作疗伤药。",
   [728] = "休大人的疗伤药已经制作完成了，他让你立即动身前往神圣王城。",
   [729] = "拿着，事不宜迟，立刻给休大人送过去吧。",
   [730] = "若琳大神官已经救回来了？这真是太好了。",
   [731] = "是的，若琳神官和菲奥烈大人准备给那位深渊魔神来个彻底了断。",
   [732] = "你的实力还不足以帮助他们对抗深渊魔神，在最终决战到来之前，好好提升自己的实力吧。",
   [733] = "决战的日子就快到了，不过以你现在的程度想要对抗深渊魔神似乎有些困难。",
   [734] = "实力提升到到一定程度后就会遇到瓶颈，想要继续提升必须点亮自己的命运之星，激活潜在的命运之力。",
   [735] = "命运之星已经全部点亮，菲奥烈和若琳还需要准备一些东西，你先适应一下命运之力吧。",
   [736] = "深渊魔神提前降临到了【永恒空间】，菲奥烈和若琳被他偷袭身受重伤，现在我们唯一的希望就只有你了！",
   [737] = "你成功破坏了深渊魔神的阴谋将勇者大陆从毁灭的边缘拉了回来。你的故事将会被诗人谱写成诗篇永世传唱！",
   [738] = "你已经受到了时光之书的祝福，快晋升巅峰吧！",
   [739] = "一些日子不见，想不到你的实力有提升了这么多。",
   [740] = "上次的战斗中，菲奥烈大人发现你体内流淌着古龙神的血脉之力，不过似乎被什么人封印了，你先试着解开封印。",
   [741] = "封印的阵眼中有灵兽守护者，打败他就能彻底破坏血脉之力的封印。",
   [742] = "血脉之力的封印已经解除，现在你需要将这股力量与自己彻底融合。",
   [743] = "龙神血脉似乎被封印了太久，对你产生了抗拒，试着降服他。",
   [744] = "上古龙神的血脉已经成功的和你融合在了一起，现在试着将这股力量彻底激发出来吧，",
   [745] = "血脉之内竟然还隐藏着一缕上古龙神的意志，以你现在的实力想要对抗龙神意志还有些难度，你再历练一段时间吧！",
   [746] = "以你现在的实力应该可以承受血脉之力的冲击，这应该是龙神对你的最后一道考验，放手一搏吧！",
   [747] = "龙神的意志消散了，现在你已经完全掌控了龙神血脉，试着将血脉的力量彻底觉醒释放吧！",
   [748] = "这下你已经有了跻身顶尖强者的资格了！",
   [749] = "艾米丽，大事不妙！深渊魔物入侵了莱克蒙德！永恒之心被摧毁了！",
   [750] = "什么？快去找[7afc23]莫吉[-]，让他通知修大人！",
   [751] = "艾米丽",
   [752] = "[fe8625]永恒之心[-]破碎，魔物肆虐，我们得让大家赶紧撤离才行！",
   [753] = "莫吉",
   [754] = "没了[fe8625]永恒之心[-]的压制，大陆上必将魔物肆虐！你快去通知修大人，问问他有没有什么办法吧！",
   [755] = "好的！那我先去通知老师！",
   [756] = "救命啊！勇士！这里好多魔物，我好怕！",
   [757] = "玛姬",
   [758] = "……小姐，你是从哪里来的？这些[fe8625]魔化甲虫[-]很危险的！你赶紧回家吧！",
   [759] = "我叫玛姬！是克拉默德大公爵的女儿！你可以不可以带我去找我的管家[7afc23]莫里斯[-]？他会好好感谢你的！",
   [760] = "勇士，您见到玛姬小姐了吗？这些魔物将我和小姐冲散了，我要赶紧找到她才行！",
   [761] = "莫里斯",
   [762] = "没事，多亏了这位勇士！莫里斯管家，你一定要好好帮我感谢他！",
   [763] = "前方的道路被那些[fe8625]骨魔卫[-]占据了，要想离开这里，必须把消灭这些魔物！",
   [764] = "没问题，包在我身上，我来清理怪蛙，你带着玛姬小姐赶紧离开吧！",
   [765] = "那就多谢勇士了！以后勇士要是到了神圣王城，请一定要来公爵府做客！",
   [766] = "修大人，你怎么在这里？莫吉呢？他不是找你去了吗？",
   [767] = "克莱蒙德已经沦陷了，我们要赶紧想办法离开这里！",
   [768] = "修",
   [769] = "嗯，那我先去和莫吉汇合，顺便帮他一把！",
   [770] = "{0}，蔚蓝之桥是离开克莱蒙的唯一道路，但是现在桥上有一只强大的[7afc23]魔蛙统领[-]！",
   [771] = "封印徽章？你是指那种[7afc23]封印着强大魔物[-]的封印徽章？",
   [772] = "没错！只要你成功击败封印魔物，就能获得徽章的力量！准备好，我送你进入徽章封印！",
   [773] = "我和莎尔丽正准备离开，谁知道突然出现了一群次元魔女！",
   [774] = "莎娜",
   [775] = "嗯？你妹妹？在哪里？我怎么没看到？",
   [776] = "咦?！莎尔丽呢！一定是跑太急一不小心就走散了！勇士！拜托你帮我找找[7afc23]莎尔丽[-]，告诉她我会在我们之前约定的地方等她！",
   [777] = "放心吧！我会帮你找到她的！",
   [778] = "你一定就是莎尔丽吧！你姐姐莎娜让我告诉你，她在约定的地方等你！",
   [779] = "真的吗？我马上过去！勇士你小心一些，前面有好大一群[ffd557]枪炮魔兔[-]！",
   [780] = "莎尔丽",
   [781] = "嘿，小家伙，这里到处都是魔物，你可别乱跑！你这细皮嫩肉的，魔物们最喜欢了！",
   [782] = "萨里顿",
   [783] = "……萨里顿大叔，咱能好好说话不！再说了，我可是很厉害的！",
   [784] = "哈哈哈哈，好好好！不过这些魔物给你练练手倒是挺不错的！正好燎在这里，她好像有些特别的消息！",
   [785] = "[ffd557]{0}[-]，原来你在这里！",
   [786] = "燎",
   [787] = "燎？你怎么来了？",
   [788] = "爱丽丝大人赶来了，但是我们在路上遇到了[fe8625]丛林魔蝎[-]的袭击，爱丽丝大人让我先来找你！",
   [789] = "我收到了修的魔法传讯，知道黄金海岸的魔物发生了暴乱，特地赶了过来！",
   [790] = "爱丽丝",
   [791] = "那太好了，爱丽丝大人，您有什么办法吗？",
   [792] = "我记得之前在一副羊皮卷轴上看过有关永恒之心的记载，但是我还需要再仔细回想一下。艾力他们正在赶来的路上，你快去接应他们吧！",
   [793] = "[ffd557]{0}[-]，刚才突然出现了一大群[fe8625]丛林魔蝎[-]把我们给冲散了！",
   [794] = "莉娜",
   [795] = "一大群魔物？没想到永恒之心的碎裂对大陆造成的影响如此恶劣！",
   [796] = "我很担心大家，你快[7afc23]骑上飞行坐骑看看他们都在什么地方[-]！",
   [797] = "怎么样？你看到大家在哪里了吗？",
   [798] = "嗯，放心吧！我已经知道他们在哪里了！我这就去把他们带回来！",
   [799] = "等等，你告诉让大家在东南面的高地集合，我和爱丽丝大人会在那里等他们！",
   [800] = "我发现这些昆虫原本并不是魔物，只是被那些魔气所感染了！",
   [801] = "艾斯",
   [802] = "被魔气感染了？这些魔气也太厉害了吧！",
   [803] = "这些魔气怕只是一个开始，我担心拖久了会产生更可怕的魔物！",
   [804] = "真是担心什么来什么！前方就有一只巨大的魔物！",
   [805] = "别着急，所有困难都会慢慢慢慢慢慢慢慢慢慢解决的！你先去东南面的高地和大家集合，这里交给我！",
   [806] = "[ffd557]{0}[-]！你怎么来了？",
   [807] = "洛克菲斯",
   [808] = "莉娜说你们遭受到了魔物的袭击，我来帮助你们！",
   [809] = "你来的正好！我刚刚清理魔物的时候发现了这枚[7afc23]封印徽章[-]！",
   [810] = "艾利克斯",
   [811] = "又是封印徽章？交给我吧，我知道怎么处理这玩意儿！你们赶紧去东南面的高地和爱丽丝大人汇合吧！",
   [812] = "艾力！你原来在这里！真是奇怪，你居然没有被魔物袭击！",
   [813] = "那些低等级的魔物我还不看在眼里，露娜在前面，你去帮助她吧！",
   [814] = "艾力",
   [815] = "好，那你赶紧去和爱丽丝大人汇合吧！",
   [816] = "露娜，你还好吧！那些魔物有没有伤害到你！",
   [817] = "[ffd557]{0}[-]！看见你真是太好了！这些[7afc23]狂暴的甲虫[-]着实有点可怕，我们一起消灭它们！",
   [818] = "露娜",
   [819] = "等等，前面的这些甲虫看起来要比其他的魔物厉害一些，我要先[7afc23]升级一下自己的技能[-]！",
