   [1204] = "这里是春之故里，一直与外界隔绝，大家在村子里快乐的生活着，从未发生过任何不愉快的事情！",
   [1205] = "汀娜",
   [1206] = "可是就在三天前，这里突然出现了好多魔物，大家仓促抵抗，不少人都受伤了！",
   [1207] = "（三天前？似乎就是我解开金字塔封印的时候？）那让我来帮你们一起抵御魔物吧！",
   [1208] = "那些魔物在肆意破坏村子里的建筑，你快帮忙将这些箱子里的武器给大家拿过去！",
   [1209] = "赫特",
   [1210] = "我看到那群魔物在进攻磨坊！莎力刚才正说要去磨坊拿些食物！",
   [1211] = "索锡",
   [1212] = "别担心，我去看看！",
   [1213] = "呼，多谢你来救我，不过那群魔物没有发现我，已经往湖边小屋去了！",
   [1214] = "莎力",
   [1215] = "你没事吧？索锡在前面等你，你快去和他汇合，那边安全点！",
   [1216] = "那拜托你去前面的小屋看看，我记得小屋里还有人！",
   [1217] = "多谢你，勇士！那群魔物的目标是永恒徽章，我一定不能让它们得逞！",
   [1218] = "吉尔",
   [1219] = "徽章？永恒徽章在哪里？",
   [1220] = "徽章在姐姐那里……不好！姐姐有危险！",
   [1221] = "既然那群魔物的目的是徽章，我把徽章扔掉，它们就不会攻击姐姐了！",
   [1222] = "蒂蒂",
   [1223] = "住手！你把徽章的封印解开，我能够消灭那群魔物！",
   [1224] = "你是说真的吗？",
   [1225] = "你竟然吸收了徽章的力量！你……你就是我们要等的永恒之子！",
   [1226] = "没错！不过现在没有时间解释那么多了，先去找你姐姐吧！",
   [1227] = "姐姐受伤了！需要止血草才行，可是止血草在小屋后面才有！",
   [1228] = "可是周围全是魔物，[ffd557]{0}[-]，你可以去帮我们采一点止血草回来吗？",
   [1229] = "等我回来！",
   [1230] = "多谢你带回来的止血草！现在我们要先离开这里才行！",
   [1231] = "玛丽安",
   [1232] = "我先去探探路！",
   [1233] = "[ffd557]{0}[-]，那边魔物很多，你有看到其他人吗？",
   [1234] = "吉尔他们在湖边小屋，你去带他们出来，我去前面探路！",
   [1235] = "[ffd557]{0}[-]，村口有一个虎族人！看起来好可怕的样子！",
   [1236] = "让我来消灭它！",
   [1237] = "村子里的魔物越来越多了，我们要小心才行！",
   [1238] = "[ffd557]{0}[-]，我们刚刚好像听到了有人在呼救！",
   [1239] = "奥蒂",
   [1240] = "没错！呼救的声音从圣泉那边传过来的！你赶紧去看看！",
   [1241] = "贝蒂",
   [1242] = "好多魔物！这些魔物好像要进攻圣树！圣树不能被破坏，快去保护圣树！",
   [1243] = "凯伊",
   [1244] = "这些魔物是沿着圣泉找到圣树的！",
   [1245] = "村子里有两眼圣泉！[ffd557]{0}[-]你快去圣树的另一边看看！",
   [1246] = "这里突然出现了一群白狐！快消灭他们！不然圣树一定会被毁掉的！",
   [1247] = "葛妮丝",
   [1248] = "这些魔物突然出现在这里，而且还要攻击圣树，简直是太蹊跷了！你快去找到法斯特，他一定知道原因！",
   [1249] = "圣树原本是存放封印徽章的地方，这些魔物进攻圣树，肯定是为了夺取徽章！",
   [1250] = "法斯特",
   [1251] = "封印徽章？圣树之下居然也有徽章？",
   [1252] = "不过在这些魔物刚刚出现的时候，我就已经将徽章取出来了！既然你来了，那你做好准备，我要解开封印了！",
   [1253] = "米歇尔",
   [1254] = "现在你已经成功吸收了徽章的力量，保护村子的责任就交给你了！",
   [1255] = "你放心，我一定会将这些魔物消灭干净的！",
   [1256] = "其实村子里有一个净化阵法，就在悬崖的另一边，你要穿过圣泉才能到达！快去吧！",
   [1257] = "[ffd557]{0}[-]，快救救埃达和莉达吧！他们被这些怪物困住了！",
   [1258] = "梵妮",
   [1259] = "多谢你！[ffd557]{0}[-]！要是没有你我们大概就要交代在这里了！",
   [1260] = "埃达",
   [1261] = "呸呸呸！姐姐我还有大好年华等着我，谁要和你交代在这里！快走啦！",
   [1262] = "莉达",
   [1263] = "[ffd557]{0}[-]，阵法的启动装置就在前面，只要启动那个符文石柱，这些魔物就能够被净化了！",
   [1264] = "亚当斯",
   [1265] = "不好，净化阵法虽然开启，但是惊动了一个巨大的魔物，我们必须消灭它！",
   [1266] = "珍妮",
   [1267] = "太好了！我去看看大家都怎么样了！",
   [1268] = "太好了！那些魔物已经渐渐退去了！[ffd557]{0}[-]你真是太厉害了！",
   [1269] = "终于安全了！对了，汀娜姐姐好在找你，你快去看看吧 ！",
   [1270] = "刚刚有一个叫莫吉的孩子说找你，他好像也是从外界来的！",
   [1271] = "莫吉？他在哪里？",
   [1272] = "他在西北边的传送台附近。",
   [1273] = "[ffd557]{0}[-]！总算找到你了！",
   [1274] = "发生了什么事？",
   [1275] = "星光山谷遭到了魔物的进攻，魔物太厉害，需要永恒之力才能击败它们！",
   [1276] = "[ffd557]{0}[-]，你要离开了吗？",
   [1277] = "是的，有地方遭受到了魔物的攻击，我得赶回去！",
   [1278] = "你处理完事情之后记得回来这里，我还有另外的消息要告诉你！",
   [1279] = "妮妮被一群魔鬼刺豚包围了！你快去救救她！",
   [1280] = "[ffd557]{0}[-]你总算来救人家了！这些刺豚太可怕了！简直要被吓死了！",
   [1281] = "没事就好，没事就好！是我来晚了！哈尔斯大叔呢？",
   [1282] = "哈尔斯大叔应该就在附近！你找找看！我先回屋子里看看！",
   [1283] = "[ffd557]{0}[-]，你找到妮妮没？",
   [1284] = "妮妮已经回屋子里了！这到底是怎么回事怎么会突然有这么多的魔物？",
   [1285] = "那先回去再说吧！",
   [1286] = "上次你消灭掉那只蜘蛛之后，这里的确是平静了一段时间。但是不知道从什么时候开始，这里的魔气悄悄变得多了起来！",
   [1287] = "悄悄变得多了起来？",
   [1288] = "没错，那些魔气增长的非常缓慢，我们几乎都没有察觉到",
   [1289] = "可是就在前几天，魔气突然变得非常强大，然后这些魔物就开始进攻我们。",
   [1290] = "魔物的进攻有没有什么目的性？",
   [1291] = "它们似乎并没有什么目的性……小心，那些鹰身女妖来了！我们快到屋子后面去躲一躲！",
   [1292] = "[ffd557]{0}[-]，刚刚有一个巨大的绯色女妖出现，哈尔斯大叔为了保护我把女妖引开了！",
   [1293] = "[ffd557]{0}[-]，那只绯色女妖就在前面，你小心一点……嘶……",
   [1294] = "你受伤了！你快带着妮妮找个安全的地方躲起来，这里交给我！",
   [1295] = "[ffd557]{0}[-]，这些女妖太多了！这样下去会有更多人受伤的！",
   [1296] = "那怎么办？爱丽丝大人你有什么办法吗？",
   [1297] = "这些女妖非常讨厌恶魔之花的味道！你去采些恶魔花来！",
   [1298] = "[ffd557]{0}[-]，你采到那些恶魔之花了吗？爱丽丝大人和修大人在小屋的后院等你！",
   [1299] = "嗯，这么多的恶魔花，够了，接下来的过程有点难受，你要碾碎这些花！",
   [1300] = "这些花看起来好像并没有那么臭，咦？你们捂着鼻子干嘛？",
   [1301] = "唔……你开始研磨那些恶魔花吧，研磨好了之后告诉我们！",
   [1302] = "好，我开始啦…………呕……这……这是什么味道……",
   [1303] = "不好，这些恶魔花的味道引来了其他的魔兽，做好准备！",
   [1304] = "[ffd557]{0}[-]？怪物已经被消灭了，你还活着吗？",
   [1305] = "我再也不要碰这些花了……呕……",
   [1306] = "活着就好，让爱丽丝用魔法把这些磨碎的恶魔花处理一下吧！处理完之后你带着这些恶魔炸弹去前面找妮妮吧！",
   [1307] = "嘻嘻，听说你一个人把那些恶魔花磨碎了？我可真是佩服你！",
   [1308] = "这些老骗子……事先也不和我说一下，接下来该怎么办？",
   [1309] = "我会将这些炸弹投入女妖的聚集地，然后你趁她们混乱的时候消灭她们！",
   [1310] = "那些女妖好像已经被你消灭的差不多了，你真厉害！",
   [1311] = "还是爱丽丝大人有办法！咦？爱丽丝大人呢？",
   [1312] = "爱丽丝收到一条紧急传讯赶回了王城，我们也赶紧过去吧！",
   [1313] = "听说克拉默德公爵获得一枚强大的封印徽章，爱丽丝正在和公爵商量，把徽章给要过来！",
   [1314] = "额……要过来？这样真的好吗？",
   [1315] = "也不是真的白要啦，看见这把剑没有，你把这把剑拔起来然后带上去找公爵大人吧！",
   [1316] = "[ffd557]{0}[-]，你来了？那把剑你带来了吗？",
   [1317] = "呐，在这里！",
   [1318] = "嗯，我先去和公爵交涉吧！",
   [1319] = "[ffd557]{0}[-]，玛姬小姐养了一只宠物……想要拜托你驯服一下……",
   [1320] = "宠物？不就是驯服宠物吗？干嘛整的这么神神秘秘的？交给我就好！",
   [1321] = "[ffd557]{0}[-]！你真厉害！那么大只的魔兽都给你驯服了！呐，这枚徽章就送给你做报酬吧！",
   [1322] = "咦？这不是封印徽章吗？你怎么……额……该不会是你偷了公爵大人的……吧？",
   [1323] = "我哪有偷！我是光明正大去他书房拿的！嗯……虽然那个时候他出去了。管他那么多的，你快解开封印吧！",
   [1324] = "怎么样？这个徽章很厉害吧？",
   [1325] = "嗯！这个徽章包含的能量果然很强大！不过，这样真的好吗？",
   [1326] = "哼，反正徽章已经给你了，父亲大人也不能拿我怎么样，啊？父亲大人？！你怎么来了！",
   [1327] = "玛姬？你要去哪儿！给我停下！",
   [1328] = "克拉默德",
   [1329] = "额……公爵大人您好！",
   [1330] = "玛姬这丫头，你先把玛姬找回来，然后带着她来公爵府找我吧！",
   [1331] = "薇娜姐姐，我这次把父亲大人气的有点厉害……你一定要帮帮人家啦~",
   [1332] = "你啊，居然偷偷拿了这么重要的东西送人，真是该打。不过克拉默德本来就准备这么做，这次他应该没有那么生气。",
   [1333] = "薇娜",
   [1334] = "真的吗？嗯，那我去采一些他最爱的紫色星光花给他，再撒个娇应该就没事啦！咦？[ffd557]{0}[-]你来啦？走，我们采花去！",
   [1335] = "[ffd557]{0}[-]，你这里的事情处理完了吗？",
   [1336] = "法斯特？你怎么来了？",
   [1337] = "这个只是我在你脑海里制造的幻想，但是这边有了新的情况，你务必尽快到地心洞穴来一趟！",
   [1338] = "父亲……人家知道错了啦，你看，这是你最喜欢的紫色星光花，你就原谅人家嘛？好不好？",
   [1339] = "别以为你撒娇我就会原谅你了，把花留下，然后自己去抄写咒语书10遍！",
   [1340] = "啊……父亲，不要啦~人家以后都会乖乖的啦！",
   [1341] = "不行，这次一定要惩罚你一次，不然你都不知道天高地厚了！[ffd557]{0}[-]，你过来！",
   [1342] = "公爵大人！",
   [1343] = "虽然玛姬在中间有捣蛋，不过也算是完成了我的意思，既然你是永恒之子，那你就好好维护大陆的和平吧！",
   [1344] = "[ffd557]{0}[-]，看你一脸欲言又止的，你有什么事情吗？",
   [1345] = "我大概要去一趟异世界，那边好像有了新的情况！",
   [1346] = "嗯，去吧！说不定那边还有新的发现呢！",
   [1347] = "[ffd557]{0}[-]，据说在这里封印着一只巨大的深渊魔蛛，浑身都是剧毒的尖刺。",
   [1348] = "封印着深渊魔蛛？难道这里也有封印徽章吗？",
   [1349] = "我觉得是的，等等，这是什么声音？！",
   [1350] = "咦？外来人？地心洞穴已经好久没有出现外来人了！",
   [1351] = "修克斯",
   [1352] = "哇！吓死我了！怎么会有那么大的蝎子啊！你又是谁啊？",
   [1353] = "我叫修克斯，是这里的居民。你刚刚说的巨大蝎子？我好像听说过这个，不过具体的大概要问问洞穴里的老人才知道吧！",
   [1354] = "修克斯，不知道从哪里突然出现了一群教廷士兵！他们正在四处抓人，实在太蛮横了！",
   [1355] = "四处抓人？光天化日之下还这样无法无天！看我来教训他们！",
   [1356] = "你是谁？为什么阻碍我们教廷办事？",
   [1357] = "圣彼得",
   [1358] = "教廷？我管你们是哪个教廷！我看你们不爽，这件事儿我管定了！",
   [1359] = "圣彼得大人！我们发现了一些带有刻痕的石柱！上面似乎有些信息！",
   [1360] = "摩多",
   [1361] = "哼！那个魔蛛献祭者果然藏在这里！所有人给我搜！",
   [1362] = "魔蛛献祭者？这是什么情况？",
   [1363] = "就凭你们也想找到献祭者？孩子们，给我上！让这些教廷的走狗们看看魔蛛大人的厉害！",
   [1364] = "[ffd557]{0}[-]，不好了，我的妻子不见了！不知道是不是被那群该死的混蛋抓走了！",
   [1365] = "你先别着急！我们先在四周找找看！",
   [1366] = "不要以为你帮着这些贱民和我们作对就是正义！你根本不知道你在做什么！",
   [1367] = "那你说说你们在做什么！如果不能给我一个信服的理由，我一定会帮助他们的！",
   [1368] = "勇士，我知道你是一个正义的人！但是在这个地方封印着一个魔蛛，我们要抓的人关系着魔蛛的重生复活！",
   [1369] = "圣比利",
   [1370] = "魔蛛重生？",
   [1371] = "没错！魔蛛麾下的恶魔们培养了一个献祭者，一旦他们完成献祭，魔蛛打破封印而出，整个地心洞穴将陷入毁灭！",
   [1372] = "[ffd557]{0}[-]，你找到茉儿的消息了吗？",
   [1373] = "我刚刚发现了这个！埃克斯，我问你一件事，你知道有关魔蛛献祭者的事情吗？",
   [1374] = "这是我送给茉儿的戒指！我知道这里封印着魔蛛，但是我从未听说过什么魔蛛献祭者啊！",
   [1375] = "我想，我大概知道关于魔蛛献祭者的事！",
   [1376] = "你知道？这个魔蛛献祭者在哪里？",
   [1377] = "这个献祭者有可能是我哥哥的妻子！因为我曾经见过几个奇怪的人来找她！",
   [1378] = "什么奇怪的人啊？小帅哥，哪里像你说的奇怪的人了？",
   [1379] = "修克斯说的奇怪的人就是你们？",
   [1380] = "矮油，都说了人家是美不是奇怪。真是不听话，看来是要叫圣蛛来教训教训你了！",
   [1381] = "没想到你看起来弱弱的，本事还不小！算啦，我们还有正事儿要做，不陪你玩儿啦！",
   [1382] = "潘诺拉",
   [1383] = "不过，如果你想陪姐姐玩儿一下的话，姐姐也可以勉为其难的留下来一会儿的！",
   [1384] = "呸！凑表脸！",
   [1385] = "你是叫[ffd557]{0}[-]是吧？你到底想不想帮助埃克斯一家？",
   [1386] = "奈希尔",
   [1387] = "你到底知道什么？",
   [1388] = "奈茉儿是埃克斯的妻子，同时也是魔蛛献祭者！如果你真的想帮助他们，那么就请先击败那只暗影蛛魔！击败它，才能证明你真有能力保护他们，我才会告诉你真相！",
   [1389] = "其实，茉儿就是那个献祭者是不是，我刚刚听到了你们的对话！",
   [1390] = "是的，那么，你想把她交给教廷吗？",
   [1391] = "不！我要带着她离开这里！勇士，麻烦你带我去找她！",
   [1392] = "茉儿是我藏起来的，如果你真的打算帮助他们，那么就跟我来吧！不过，小心这一路的危险哦！",
   [1393] = "[ffd557]{0}[-] ，你是不是知道些什么？所以要背着我们做些什么？",
   [1394] = "我不知道你在说什么！快让开！我还要去寻找封印呢！",
   [1395] = "可是看你的样子却是不像不知道呢！你去寻找封印吧！我们也不打扰你了！",
   [1396] = "你怎么这么慢！是不是被教廷的那些走狗给缠住了？",
   [1397] = "没错！他们很可能在跟踪我，我必须先把他们甩掉才行。你先去目的地等我，我很快就来！",
   [1398] = "[ffd557]{0}[-]，你的脸色怎么这么难看？你被鬼追啦？",
   [1399] = "朱蒂",
   [1400] = "鬼倒是没有，就是小猫小狗三两只而已。",
   [1401] = "你才是狗！你全家都是狗！谁愿意跟着你啊！",
   [1402] = "那你就别跟着啊！你看前面还有些宝箱呢！你要不要一起看看啊？",
   [1403] = "简直不可理喻！你怎样就怎样吧！我不干了！",
   [1404] = "怎么样？你甩开他们了吗？",
   [1405] = "甩开了！茉儿在哪里？不过刚刚我遇到了一个来自地心的恶魔，虽然我用尽全力击败了他，但是却并没有消灭他！",
   [1406] = "来自地心的恶魔？！快！跟我来！",
   [1407] = "哟，小美人儿，你怎么追着姐姐到这里来了？是想我了吗？",
   [1408] = "你这个妖女太恶心了！去死吧！",
   [1409] = "你太不怜香惜玉了！看来姐姐还是要给你点颜色看看才行呢！",
   [1410] = "你是谁？希尔呢？",
   [1411] = "奈茉儿",
   [1412] = "是希尔叫我来找你的！我带你去找埃克斯！",
   [1413] = "好！",
   [1414] = "茉儿，你真的打算就这么走了？看来你是打算让这整个地心洞穴的人代替你去献祭咯？",
   [1415] = "你少吓唬人！没了献祭者，你们拿这里的村民来献祭也没用！",
   [1416] = "真的吗？那我就不阻拦你了！你们走吧！",
   [1417] = "不行！我不能离开这里！村民们沾染了我的气息，他们利用所有村民血祭魔蛛，魔蛛一样能破开封印！",
   [1418] = "什么？那怎么办？",
   [1419] = "待会献祭的时候我会想办法和魔蛛争夺主控权，你趁机消灭它的肉身，说不定我 还能得救！",
   [1420] = "[ffd557]{0}[-]，魔蛛献祭者呢？我知道你肯定有她的消息！",
   [1421] = "茉儿已经和魔蛛同归于尽了！",
   [1422] = "你是说真的？如果这样的话，看来我们也应该离去了！",
   [1423] = "[ffd557]{0}[-]，我想，你大概需要这个！",
   [1424] = "封印徽章？你怎么会有这个的？",
   [1425] = "我刚刚做了个梦，梦见茉儿说让我把这个交给你，醒了之后这个徽章就在我手上了！",
   [1426] = "你居然能够吸收这个徽章的力量，你一定是一个非常伟大的人！",
   [1427] = "伟大算不上，不过我一定会努力保护这个世界的安全！",
   [1428] = "你收到那枚徽章了吗？",
   [1429] = "那枚徽章是你给埃克斯的？",
   [1430] = "不，是茉儿！虽然茉儿的身体和魔蛛同时摧毁了，但是灵魂保存了下来！我会想办法为她恢复身体的！",
   [1431] = "[ffd557]{0}[-]，又有新的任务了，准备好出发了吗？",
   [1432] = "我当然准备好啦！",
   [1433] = "唔，那接下来应该去哪里呢？让我们好好想想吧！",
   [1434] = "首席副本挑战已开启，赶快进入副本吧！！",
   [1435] = "首席副本管理员",
   [1436] = "时空之门已经关闭！！",
   [1437] = "大事不妙！深渊魔物入侵了莱克蒙德！永恒之心被摧毁了！",
   [1438] = "snd_map_5100010",
   [1439] = "snd_map_5100020",
   [1440] = "snd_map_5100030",
   [1441] = "蔚蓝之桥是离开克莱蒙的唯一道路，但是现在桥上有一只强大的[7afc23]魔蛙统领[-]！",
   [1442] = "莎尔丽为了保护我的安全，正在独自面对那群魔物！",
   [1443] = "该死的魔物！我绝对不允许你们伤害姐姐一根头发！",
   [1444] = "爱丽丝大人和燎正在开启前往黄金海岸的传送阵，你快去帮帮她们！",
   [1445] = "勇士！快！把这些宝石魔将消灭掉，它们想要阻止爱丽丝大人开启传送阵！",
   [1446] = "多亏了你的帮忙，传送阵已经打开，莉娜正在黄金海岸，我很担心她的安全！",
   [1447] = "[ffd557]{0}[-]，刚才突然出现了一大群魔物把我和同伴们给冲散了！你快[7afc23]骑上飞行坐骑看看他们都在什么地方[-]！",
   [1448] = "你骑上小灰去找找大家吧，告诉他们去东南面的高地集合，我会在那里等他们！",
   [1449] = "snd_map_5100150",
   [1450] = "我发现这些昆虫原本并不是魔物，只是被那些魔气所感染了！跟我来！",
   [1451] = "不好，前面有一只巨大的魔物，看起来很可怕，[ffd557]{0}[-]，交给你了！秒怂.jpg",
   [1452] = "那些魔物简直不堪一击，你快去帮助其他人吧！",
   [1453] = "这里的魔物我已经清理掉了，露娜在前面好像有些吃力，你去帮助她吧！",
   [1454] = "那我带露娜去汇合，你再看看有没有其他人吧！",
   [1455] = "你看 ，这个经验法阵凝聚出了很多[7afc23]哥布林[-]！他们身上有经验纹章的碎片，你去收集10个碎片过来！",
   [1456] = "很好，这些就是经验纹章碎片，稍等……",
   [1457] = "呐，给你，有了这个经验纹章，你就能够更快速度成长了！等等？我好像听见了莉娜的声音！你看那边！",
   [1458] = "snd_map_5100280",
   [1459] = "[ffd557]{0}[-]，还记得之前你遇见的几个封印徽章吗？只要能够将大陆上的封印徽章集齐，就能够利用徽章的力量修复永恒之心！",
   [1460] = "[ffd557]{0}[-]！做好准备，待会爱丽丝大人会将这里的魔气凝聚成为一个魔物，你一定要消灭它！",
   [1461] = "你做的很好！你先去和莫吉汇合，我还有其他的事情。",
   [1462] = "[ffd557]{0}[-]，修大人在前面等你，看起来似乎有重要的事情要找你！",
   [1463] = "我和爱丽丝一致认为，修复永恒之心的重任交给你最合适！现在你先去星光山谷吧，那里有下一枚徽章的线索！",
   [1464] = "snd_map_5100340",
   [1465] = "勇士，小巴尼被那些蚊兽给困住了，快去救救他！",
   [1466] = "哇！吓死本兔兔了！这些该死的蚊兽！哎哟~痛痛痛，痛死兔了！快带我去找妮妮吖！",
   [1467] = "巴尼你怎么受伤了？这是蚊兽的伤口，需要火萤树的果实才能治疗，跟我来！",
   [1468] = "呼~本兔感觉舒服多了！那个谁，[ffd557]{0}[-]，救命之恩要以身相许，以后本兔就跟着你混了！",
   [1469] = "snd_map_5200040",
   [1470] = "[ffd557]{0}[-]，你要调查徽章的话，先去问问纳尔吧！他常年巡视山谷，肯定知道山谷里那些不寻常的地方！",
   [1471] = "我记得几天前露露好像有提到一个地方很奇怪，不过露露现在正在林中巡视，你去找找她吧！",
   [1472] = "你这样漫无目的的找也不是办法，你先去一趟神圣王城吧，在那里先提升一下你的实力再继续寻找也不迟！",
   [1473] = "嘿！你的坐骑看起来实力好像很弱呢！你需要对它进行一些强化！",
   [1474] = "阿比芭",
   [1475] = "勇者大陆上还有很多有趣的坐骑，你要是有兴趣的话可以去收集看看，据说有些坐骑还能飞上天哦！",
   [1476] = "阿尔芭",
   [1477] = "snd_map_5200100",
   [1478] = "看看你的背包，都已经快塞满了！你应该清理一下了！",
   [1479] = "娜塔莎",
   [1480] = "[ffd557]{0}[-]，哈莉奎因说想要给你一些指导，你快去找她吧！",
   [1481] = "韦德",
   [1482] = "在神圣广场附近有许多首席雕像，它们能够给你一些首席任务，可以帮助你快速升级！",
   [1483] = "哈莉奎茵",
   [1484] = "看你的样子一定是在找这些雕像吧！这些首席雕像每天都可以给你20个任务，一定不要忘记啊！",
   [1485] = "索尔",
   [1486] = "[ffd557]{0}[-]，一个人闯荡这勇者大陆始终还是弱了些，在合适的时候还是选择一个好一点的公会吧！",
   [1487] = "丹尼尔",
   [1488] = "找到合适的公会了吗？没有找到的话，康斯坦丁也许能给你一些建议！",
   [1489] = "波顿·克莱蒙德",
   [1490] = "可以选择人多的公会加入，这样一定会有很多伙伴！还能有公会仓库可以换装备呢！",
   [1491] = "康斯坦丁",
   [1492] = "看你在王城里没头脑的乱转，我来告诉你一个快速提升实力的捷径！",
   [1493] = "戴安娜",
   [1494] = "咦？你回来啦！塞西尔发现了一只赤背甲虫！",
   [1495] = "赤背甲虫拥有可以飞翔的力量，能够激活翅膀！快去击败它！",
   [1496] = "快试试激活你的翅膀吧！",
   [1497] = "爱丽丝大人传讯过来，希望你能够回去王城一趟！",
   [1498] = "[ffd557]{0}[-]你的使命之路还很长，加油吧！为了勇者大陆的和平！",
   [1499] = "[ffd557]{0}[-]，你来的正好！修大人为你找到了一件封印神器，保持提升封印等级，你的战斗力就会变得更加强大！",
   [1500] = "为了能让你更好的完成任务，我和爱丽丝还为你准备了一个特训，你去找爱丽丝吧！",
   [1501] = "[ffd557]{0}[-]，你现在先去黄金海岸找到戴安娜导师，完成任务之后她会给你下一步提示！",
   [1502] = "你能够闯过那群格林蛙人来到这里就已经通过我的训练了，接下来是寻人的特训，你需要去找到我的徒弟们，去吧！",
   [1503] = "没想到这么快就给你找到了，詹姆斯和爱娜可没有那么容易给你找到的，去吧！",
   [1504] = "我藏这么隐蔽还是被是找到了，呐，看我和你这么有缘，我给你指导一下可以帮助你变强的方法吧！",
   [1505] = "你就是[ffd557]{0}[-]？还挺聪明的嘛，这么快就找到我了。老师对你的特训已经结束了，接下来你去找韦德导师吧！",
   [1506] = "[ffd557]{0}[-]，我这边的特训很简单，看到前面那些山猫守卫了吗？闯过它们的营地，找到汉森，他会告诉你接下来应该怎做的！",
   [1507] = "你就是[ffd557]{0}[-]对不对？你终于来啦，我都等你好久啦！你只要在森林里找到莫吉就完成我这里的任务啦！",
   [1508] = "咱们又见面啦！我可以带你去一个叫妖精幻境的地方，击杀那里的怪物可以获得超高经验哦！",
   [1509] = "快去找丹尼尔导师吧，他会给你下一个试炼！",
   [1510] = "前面是雪灵狐的聚集地，你去捕捉一些雪灵狐给莫克斯！",
   [1511] = "你竟然捉到这么多灵狐，很厉害嘛！快去找酷比吧！",
   [1512] = "能够通过前面的训练，看来你是真的很不错哦！",
   [1513] = "[ffd557]{0}[-]，接下来是最后一个导师，娜塔莎导师的训练了，快去吧！",
   [1514] = "[ffd557]{0}[-]，你的成长速度已经很快了，这最后一次的训练将由我的徒弟给你，去找他吧。",
   [1515] = "先去找圣彼得吧，找到他之后他会告诉你训练内容的！",
   [1516] = "你一定就是[ffd557]{0}[-]吧！训练的内容很简单，就是找到摩多，不过你的先穿过灰狐的领地才能找到他哟。",
   [1517] = "[ffd557]{0}[-]，你找到我就代表着特训结束了，现在你会圣城去找蜜雪莉雅吧，她会给你关于徽章的指引。",
   [1518] = "杰拉德说在极寒霜原有徽章的消息，你快去看看吧！",
   [1519] = "没错，我收到有确切消息，在极寒霜原有着徽章的存在。艾利克斯已经在为你安排了，你去问问他。",
   [1520] = "[ffd557]{0}[-]，我的朋友朱丽叶为你打听到了徽章的下落，你去霜原找她吧！",
   [1521] = "你就是[ffd557]{0}[-]对不对？你可真厉害，哪些冰蝎真的挺可怕的！咱们马上出发吧！",
   [1522] = "在这附近就有一枚封印徽章，不过这里好像是[7afc23]冰霜猪人[-]的巢穴，咱们可得小心点！",
   [1523] = "你这么久没出来，我差点以为你要狗带了！不过正好，你趁现在去挑战副本试试吧！",
   [1524] = "看你从挑战副本里获得了很多战魂点嘛！我来教你获取战魂！",
   [1525] = "[ffd557]{0}[-]？刚刚突然发生了一阵蟹潮！突然出现了太多的霜原毒蟹！",
   [1526] = "嘿！[ffd557]{0}[-]，朱丽叶就在前面，不过在去找她之前，你能帮我收集一些蟹钳给卡米拉吗？",
   [1527] = "咦？你是谁？为什么会出现在这个霜龙祭坛？",
   [1528] = "昨晚我听到这里似乎有一阵奇怪的咆哮，我以为是霜龙封印被解除了！",
   [1529] = "[ffd557]{0}[-]，我已经找到了封印徽章的具体位置了！另外，我还发现了两本书！",
   [1530] = "我看你似乎学会了一个新的技能？这很好，继续前进吧！",
   [1531] = "叔叔前段时间去打猎被猎物伤了腿，我们需要一些魔蛙晶核为叔叔疗伤！",
   [1532] = "实在是太感谢你了勇士！咱们先回去吧！",
   [1533] = "前面突然来了一群雪域云兽，咱们小心一些！",
   [1534] = "我的伤势有些严重，光有这些触须怕是不够的！还需要赤背甲虫的晶核才可以！",
   [1535] = "寒冷的天气阻挡了叔叔伤口的愈合，如果能够有一些云兽的皮毛来保暖就好了！",
   [1536] = "有了这些皮毛，叔叔就不会受到那些寒冷的侵蚀了！",
   [1537] = "我们抢夺了宝藏来到这里，没想到遇上了更凶悍的盗匪！",
   [1538] = "勇士，这是我们刚刚抢到的宝箱，里面只有一枚徽章。麻烦你帮我救回我的同伴，这枚徽章就给你了！",
   [1539] = "你是说真的吗？老大在前面等我们？不过这些骷髅魔物太凶悍，人家怕怕~",
   [1540] = "哇啊~~救命啊~~这是什么地方啊~~老大在哪里啊~",
   [1541] = "[ffd557]{0}[-]！没想到你也在这里！最近沙漠中的金字塔似乎有些异动，我们去调查一番吧！",
   [1542] = "我们需要一些红水晶来制作护目镜，去采集一些回来吧！",
   [1543] = "天哪！我们好像陷入了这些猪人的包围圈了！我们得赶紧逃跑才是！",
   [1544] = "米娅！路易！我在这里！这里太可怕了！我们赶紧离开吧！勇士，藏宝图就送给你了！",
   [1545] = "[ffd557]{0}[-]，这里太危险了，可是玛姬小姐也跟来了，咱们要好好保护她！",
   [1546] = "藏宝图？给我看看！嗯，好像要经过铁角豹人的栖息地呢！",
   [1547] = "前面就是铁角豹人的栖息地啦，我们小心一点！",
   [1548] = "嗯，我们似乎需要一种神秘的金币，这种金币被埋在了绿洲与金字塔之间的沙地里！",
   [1549] = "那些铁角豹人似乎发现我们了，快逃！",
   [1550] = "这么多兽人，我们小心一点，一人一半！",
   [1551] = "嘿！[ffd557]{0}[-]！没想到咱们又见面了！没想到你这么快就能找到金字塔的所在！",
   [1552] = "勇士，你好，我被一群怪物抓来了这里，它们大概是为了我所守护的这枚徽章吧！",
   [1553] = "没想到你居然能够打败徽章封印的魔物！徽章能够交给你，我的使命也完成了！",
   [1554] = "没想到居然在这里会有徽章守护者！不过，我们现在先解开金字塔封印吧！",
   [1555] = "看到这些符文石柱了吗？想办法把它们连起来！",
   [1556] = "前面有一群火岩甲兵拦路，你快去处理掉他们！",
   [1557] = "既然小姐想要完成最后一件事情，那我也只能尽量配合了！",
   [1558] = "那些火岩甲兵是封印的守护怪物，没想到你竟然能轻松搞定！现在你去找尤里克吧！",
   [1559] = "[ffd557]{0}[-]你看！前面出现了一道光出现了！我们跟着光走吧！",
   [1560] = "[ffd557]{0}[-]，那个传送阵的气息，似乎是通往烈焰战场方向！",
   [1561] = "[ffd557]{0}[-]，朱丽叶传来讯息，说是在烈焰战场又有封印徽章的消息！",
   [1562] = "这么巧？那你赶紧去烈焰战场吧！我记得那边有很多火蜥蜴，你可得小心了！",
   [1563] = "[ffd557]{0}[-]，我跟着之前的线索寻找，没想到竟然找来了这里！走吧，我的朋友们就在前面！",
   [1564] = "在附近有一些带着封印气息的泥土，这些泥土肯定与封印有关！",
   [1565] = "你收集一些泥土给我，我试试能不能查到这些气息的源头！",
   [1566] = "不好，这里突然出现了许多紫晶石怪，这肯定与封印有关！",
   [1567] = "刚才这里突然猛烈的摇晃了一下，似乎有很多魔物从地底钻了出来！",
