   [1571] = "你果然很厉害！勇者大陆的安全就靠你了！走吧，去找第二枚徽章！",
   [1572] = "刚刚解决了灵傀儡，又出现了灵傀将！这些魔物可比灵傀儡厉害多了！",
   [1573] = "[ffd557]{0}[-]，刚刚那些灵傀将没有伤到你吧？",
   [1574] = "莫克斯那里有新的线索！你快去找他吧！",
   [1575] = "最近附近出现了一个奇怪的事情，好像出现了一些看不见的东西！",
   [1576] = "虽然看不见那些东西，但是地上却有着他们的脚印！你去看看吧！",
   [1577] = "这些脚印看起来和寻常人似乎没什么区别，这就有些难办了！",
   [1578] = "我沿着脚印往前走，发现了那些骷髅前锋！我们似乎离封印更近一步了！",
   [1579] = "[ffd557]{0}[-]，我似乎感应到了一些不一样的气息！沿着这条路继续往前走，应该会有所发现！",
   [1580] = "快！霍布森好像有些发现！",
   [1581] = "看！这里有些神秘的石刻！这些石刻压抑了封印徽章的气息！赶紧把这些石刻摧毁掉！",
   [1582] = "果然！一旦摧毁了这些石刻，徽章的气息就猛烈的爆发了出来！这些骷髅将军也随之出现了！",
   [1583] = "那些骷髅将军只是开始，后面还有更厉害的魔物！",
   [1584] = "封印的气息在这附近最为强烈，消灭掉那些宝石战将，徽章应该就会出现了！",
   [1585] = "做好准备，这即将是一枚强大的徽章！",
   [1586] = "[ffd557]{0}[-]，麻烦你将这把传说之剑带给艾西，他们需要依靠这把剑的力量来压制魔物！",
   [1587] = "太好了，有了这把剑，那些魔物就再也不敢猖狂了！",
   [1588] = "[ffd557]{0}[-]，前面好像传来了奇怪的声音，你快去看看！",
   [1589] = "这些幽灵巨刃突然就出现了！哪怕是传说之剑也无法压制住他们的力量！",
   [1590] = "还好有你，这些幽灵巨刃的战斗力太可怕了！对了，刚刚艾斯好像在找你，你快去看看吧！",
