   [1595] = "屋后的湖里还有些鹰身女妖想要冲上来，拜托你帮我们解决她们！",
   [1596] = "你现在的力量还不足以前往下一个地点，先努力升级吧！",
   [1597] = "没了那些隐身女妖的威胁，我们这里就轻松多了！你去找赫特吧！",
   [1598] = "[ffd557]{0}[-]，莉莉安在村口，你快去看看她！",
   [1599] = "[ffd557]{0}[-]，村口有一群灰狐！看起来好可怕的样子！",
   [1600] = "村子里有两眼圣泉！勇士你快去圣树的另一边看看！",
   [1601] = "这边果然受到了攻击！快消灭掉那些白狐！",
