   [1621] = "这些魔鲀太可怕了！不过好像大家的混乱情况减轻了不少！",
   [1622] = "看来只有消灭掉这些利齿魔鲀，才能够彻底终结这一场混乱！",
   [1623] = "落日之都终于恢复了平静！真是太感谢你了！你要去水晶之巅看看吗？",
   [1624] = "这里原本有着许多七彩水晶，动物们在这里生活的非常快乐！可是最近突然发生了异变，动物们竟然都慢慢的被晶化了！",
   [1625] = "小心！那里有很多晶化的魔蝎，你看看能不能从它们调查出一些什么！",
