   [1635] = "封印徽章的力量似乎打开了通往魔咒源头的道路！",
   [1636] = "魔咒的源头似乎是一群晶化骷髅，它们的力量污染了水晶的魔力！",
   [1637] = "看来只要能够解决掉这些骷髅，水晶的魔咒就能够解除！出发吧！勇士!",
   [1638] = "魔咒解除，水晶之巅终于恢复了安宁，勇士，在附近有一个地心洞穴，你要去那里看看吗？",
   [1639] = "地心洞穴非常的危险，你一定要有充足的实力！",
