   [1646] = "外来人！就是你们这些外来人，触怒了魔蛛大人！",
   [1647] = "魔蛛大人本来守护着我们的洞穴，都是你们这些外来者，害得魔蛛大人抛弃了我们！",
   [1648] = "天哪！是红纹蟹！这些原本是魔蛛大人的使者，现在居然开始攻击我的族人们了！",
