   [21731] = "1_384;2_19;3_9;4_19;5_9;6_3",
   [21732] = "永恒空间中存放着诸神时代的神器【时光之书】，由并且留下了两位守护者保卫这里。",
   [21733] = "只要通过这里的试炼，就能触摸【时光之书】来获得更加强大的力量！",
   [21734] = "那么接下来，挑战开始！请小心那些机关……",
   [21735] = "奇怪，这里怎么被封住了？不过问题不大，我能搞定！",
   [21736] = "年轻人别发呆，跟上我，这里似乎有古怪！",
   [21737] = "小心，这是深渊生物！他们为什么会出现在这里？快消灭他们！",
   [21738] = "他的样子很奇怪，[ffff00]{0}[-]，不要伤着菲奥烈大人！",
   [21739] = "菲奥烈大人，您怎么了？",
   [21740] = "我被深渊生物袭击了，意识陷入了沉睡，若琳大神官也下落不明……",
   [21741] = "永恒空间竟然出现了深渊生物，这……这怎么可能！",
   [21742] = "我要留下查清楚这件事情，而且我必须找到若琳大神官！",
   [21743] = "好的大人，请您一切小心！[ffff00]{0}[-]，这里太危险了，我们先离开吧！",
   [21744] = "[ffff00]{0}[-]，我需要你的帮助。",
   [21745] = "永恒空间里出现了许多深渊生物，似乎在密谋着什么。",
   [21746] = "跟上我，让我们去看看他们究竟在搞什么鬼！",
   [21747] = "可恶，看来我们被发现了……上吧，这次我们没有退路！",
   [21748] = "这该死的深渊生物，还有完没完了！",
   [21749] = "够了，愚蠢的人类！放弃无谓的抵抗吧！",
   [21750] = "用不了多久，伟大的深渊之神将会降临这里，而你们，将会被我撕成碎片！",
   [21751] = "你似乎高兴的太早了！",
   [21752] = "哼，不自量力的家伙！",
   [21753] = "[ffff00]{0}[-]，多亏了你的帮忙！你先回去一趟王城报告，我去查查他说的深渊之神降临到底是怎么一回事！",
   [21754] = "入侵者，你们休想伤害[ffff00]艾露西亚[-]！",
   [21755] = "[ffff00]格兰迪[-]倒下了，你们将为此付出代价！",
   [21756] = "圣光将禁锢一切邪恶！",
   [21757] = "复活吧，我的勇士！",
   [21758] = "为你而战，女士！",
   [21759] = "愚蠢的闯入者们，这里不是你们该来的地方！",
   [21760] = "激怒飓风，你们将会后悔的！",
   [21761] = "现在停止你们愚蠢的行为还来得及！",
   [21762] = "我要把你们炸个粉碎！",
   [21763] = "来吧，尝尝这个！嘻嘻嘻嘻…………",
   [21764] = "游戏……还没有结束……",
   [21765] = "极寒之风将会冻结你们的灵魂！",
   [21766] = "北风精灵，快来协助我！",
   [21767] = "我的王，他们……来了……",
   [21768] = "凡人，你们的确很令我惊讶，我没有料到你们竟然可以走到这里。接下来我会用自己的方式招待你们！",
   [21769] = "风暴的仆从，献祭你的灵魂吧！",
   [21770] = "你们做的很好，但是……这毫无意义！",
   [21771] = "你们……只是在拖延必然的命运！",
   [21772] = "风暴面前……你们的意志一无是处！",
   [21773] = "你们的旅途才刚刚开始……",
   [21774] = "你来了，这是……休做的疗伤药？",
   [21775] = "我感觉好多了，[ffff00]{0}[-]，十分感谢你的帮助。",
   [21776] = "我找到若琳的下落了！跟上我，我需要你的力量。",
   [21777] = "滚开，你们这些肮脏的深渊魔物！",
   [21778] = "我看见她了，就在桥的那边……",
   [21779] = "她在企图召唤深渊魔神，我们必须阻止她！",
   [21780] = "停下，若琳！你知道自己在做什么吗？",
   [21781] = "我当然知道自己在做什么，愚蠢的守护者！",
   [21782] = "你们阻止不了深渊之神的降临，拦住他们，我的仆人们！",
   [21783] = "很好，看来必须我亲自动手了！",
   [21784] = "该死的，她的神智也被深渊魔神控制了。[ffff00]{0}[-]，帮帮我！",
   [21785] = "菲奥烈？我……我这是怎么了？天啊，你受伤了！",
   [21786] = "没事了， 若琳……深渊生物袭击了我们，他们企图控制你来召唤深渊魔神降临永恒空间！",
   [21787] = "深渊魔神？看来那个家伙对【时光之书】还没有死心。",
   [21788] = "我们需要给那个不知天高地厚的家伙一点教训了。",
   [21789] = "菲奥烈，你先好好养伤，我需要准备一些东西！",
   [21790] = "预留",
   [21791] = "蠢货，就凭你一个人也妄想阻挡伟大的恶魔军团！",
   [21792] = "永恒之心就在眼前，今天恶魔进团必将取得胜利！",
   [21793] = "可恶的冒险者，我要亲自撕碎你！",
   [21794] = "迪亚罗竟然战败了？",
   [21795] = "噬骨灵，进攻！",
   [21796] = "我的军团是无穷无尽的！",
   [21797] = "小虫子，我要碾碎你的骨头，现在跪下求饶，还来得及！",
   [21798] = "你真以为打败了我那两个愚蠢的手下就可以阻止我？你太天真了。",
   [21799] = "你将会为你的愚蠢行为付出代价！",
   [21800] = "看来是我小看了你，冒险者。可是你还能撑多久呢？",
   [21801] = "你根本不知道自己面对的是怎样的伟大存在，准备好迎接我的怒火了吗？",
   [21802] = "恶魔军团是不可阻挡的，见证你们的死亡和绝望吧！",
   [21803] = "停下！入侵者，这里不是你们该来的的地方！",
   [21804] = "野性的血脉在我体内熊熊燃烧，你们激怒我了！",
   [21805] = "入侵者，在我的面前你们就如蝼蚁一般渺小。而我，是你们无法仰望的高山！",
   [21806] = "难道你们就这点本事吗？这点攻击，无关痛痒！",
   [21807] = "漂亮的全垒打！",
   [21808] = "漫长的生命中我目睹了无数企图染指生命温室的人，他们都成了座花园的养料，你们也不例外！",
   [21809] = "森林之子，快来帮助我！",
   [21810] = "有人想上天吗？",
   [21811] = "这座神殿的存在比这个世界的本身还要古老，究竟是什么在驱使着你们探寻着她的奥秘？",
