   [33595] = "赤城精锐",
   [33596] = "1.培养用来提升主装备培养等级。\n\n2.与主装备同部位，同品质，同等级的装备方可进行培养操作(不区分职业)。\n\n3.材料装备在培养后会消失。\n\n4.材料装备的培养等级会继承到主装备。\n\n  如：主装备+3，材料装备+2，培养后主装备+5\n\n5.培养等级最高10级。",
   [33597] = "1.升星+1 ~ +5，失败不会降低升星等级\n\n2.升星+6 ~ +10，失败升星等级-1\n\n3.升星+7以上可以放入女神之泪，失败时保护升星等级不变。\n\n4.装备升星+7、+9、+11装备会出现流光效果",
   [33598] = "1. 融合需求两件培养满级，同职业，同部位，同品质的装备\n\n2. 融合后，两件装备都会消失，并获得1件新装备，新装备将有如下变化。\n\n3. 新装备的成长资质和工艺品质，将有原来两件装备的平均成长资质和工艺品质决定。\n\n4. 原来两间装备携带的技能，均有一定机率保留下来。",
   [33599] = "1. 技能小于1个时，学习技能只会增加，不会顶替。\n\n2.技能数量达到最大时，学习技能只会顶替原有技能。\n\n3.带有技能的装备，出售、吞噬、合成时拥有的技能都会按技能书返还。",
   [33600] = "1. 重铸后装备培养等级变为1级\n\n2. 成长资质重新生成\n\n3. 技能重新生成",
   [33601] = "1. 同部位，同类型的装备才可进行精炼.\n\n2. 精炼后材料装备属性会顶替主装备属性.\n\n3. 精炼后材料装备消失 .",
   [33602] = "1.材料装备的技能会全部继承到主装备，主装备技能会丢弃.\n\n2.当材料装备技能数量大于主装备技能格子上限时，只能继承主装备格子上限的数量.",
   [33603] = "1）金色钻石装备需要3-5件橙色钻石装备用于合成，放入装备越多，合成成功概率越高；\n\n2）红色钻石装备需要3件金色钻石装备合成，在合成时可以放入“元素神石”用于提高成功概率；\n\n3）合成成功以后，可以获得对应装备，合成失败以后，所有材料都会消失；\n\n5）带有技能的装备参与合成后，会返还对应技能书材料；\n\n6）绑定的装备不能参与合成；\n\n7）在合成时，只能用同职业的装备进行合成;\n\n8）合成一钻红色装备时，可以放入增加合成成功几率的道具来100%合成出红色装备。",
   [33604] = "1. 每次购买可立即抽得一份奖励\n2. 开奖剩余份数为0时或倒计时结束时立即揭晓幸运大奖\n3. 每位参与的玩家都有可能获得幸运大奖，购买份数越多，中奖几率越高。",
   [33605] = "1）每击杀1个BOSS幻境中的BOSS，拥有掉落归属的玩家会增加1点BOSS疲劳；\n\n2）当人物当前疲劳达到上限值以后，本日将无法对BOSS幻境中的BOSS造成伤害；\n\n3）BOSS疲劳在每天凌晨0:00清零。",
   [33606] = "1.5阶橙色以上装备或7阶橙色以上首饰可锻造[00ff00]天怒套装[-]。5阶橙色[00ff00]带钻[-]的[00ff00]天怒套装[-]可锻造为[00ff00]神怒套装[-]\n2.同阶的武器、头盔、衣服、腰带、护腿、鞋子可锻造为[00ff00]防具套装[-]；项链、戒指可锻造为[00ff00]首饰套装[-]，首饰套装可以不同阶。\n3.穿戴套装后可激活[00ff00]套装属性[-]\n4.装备替换时可拆解或转移套装效果[00ff00]（不会损失套装石材料）[-]",
   [33607] = "1.玩家等级在[00ff00]300级到巅峰220级[-]之间，且达到[00ff00]VIP2[-]可以参加巅峰投资。\n2.投资档位为[00ff00]880/1880/2880[-]蓝钻，投资后可以获得最高[00ff00]15倍[-]火钻返利。\n3.投资额度未满的玩家可以追加投资，追加后可以通过邮件补领火钻。",
   [33608] = "1.玩家等级在[00ff00]巅峰220级到巅峰430级[-]之间，且达到[00ff00]VIP2[-]可以参加巅峰投资。\n2.投资档位为[00ff00]1280/2680/3280[-]蓝钻，投资后可以获得最高[00ff00]18倍[-]火钻返利。\n3.投资额度未满的玩家可以追加投资，追加后可以通过邮件补领火钻。",
   [33609] = "1. 消耗血之精魄来升级血脉。\n2. 血之精魄在400级以上的BOSS掉落。",
   [33610] = "参与规则\n1.需要创建或加入[00ff00]战队[-]才可参与对决\n2.可[00ff00]单人匹配[-]或[00ff00]组队匹配[-]，组队匹配时[00ff00]队伍成员[-]必定在[00ff00]同一阵营[-]。建议战队成员组队匹配战斗。\n3.活动为[00ff00]跨服匹配[-]，可能遇到[00ff00]其他服务器[-]的对手\n4.战斗结束根据[00ff00]队员[-]的战斗结果来[00ff00]增减战队的排位积分[-]\n5.每场战斗结束[00ff00]无论胜负[-]都可[00ff00]获得奖励[-]\n\n战队说明\n1.战队中每个[00ff00]队员[-]的战斗结果都会影响[00ff00]战队[-]的排位积分\n2.战队[00ff00]段位积分[-]会影响每个赛季的[00ff00]战队段位[-]\n3.段位依次分为：[00ff00]曜石[-]、[00ff00]黑铁[-]、[00ff00]紫晶[-]、[00ff00]宝石[-]、[00ff00]传奇[-]、[00ff00]神话[-]\n4.[00ff00]赛季结算[-]后会根据[00ff00]战队的段位[-]来给战队中的[00ff00]队员[-]发放奖励\n5.匹配战斗时，[00ff00]战队成员[-]只有[00ff00]组队[-]才会分到同一个阵营，建议战队成员组队匹配战斗\n6.赛季结算的[00ff00]最后7天[-]无法踢出队员或解散战队\n\n赛季说明\n1.[00ff00]每月1号0点[-]旧赛季结束，进入新赛季\n2.每个赛季都有[00ff00]功勋奖励[-]和[00ff00]赛季目标[-]\n3.赛季中[00ff00]功勋值[-]达到指定目标即可领取[00ff00]功勋奖励[-]\n4.赛季结束时，战斗[00ff00]满20场[-]的玩家可领取赛季目标奖励\n5.达到领取[00ff00]排名奖励[-]条件的玩家领取[00ff00]排名奖励[-]后无法再领取[00ff00]段位奖励[-]",
